import React from 'react'
export default function Play() {
    return (
        <div>
            <div className='deeev'>
                <h3 className='heading'><span style={{ color: 'red' }}>K</span><span style={{ color: 'orange' }}>r</span><span style={{ color: 'yellow' }}>i</span><span style={{ color: '	#00FF00' }}>b</span><span style={{ color: '#00bfff' }}>b</span><span style={{ color: 'blue' }}>l</span><span style={{ color: '#FF1493' }}>e</span><span style={{ color: 'purple' }}>.</span><span style={{ color: 'white', fontSize: '5rem' }}>io</span></h3>
                <img src='https://i.gifer.com/origin/13/138f23942529ef47c75c33c9c9ab81d1_w200.gif' style={{marginLeft: '20px', marginTop: '14px', marginBottom: '0px'}} />
            </div>
        </div>
    )
}
